  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:00.761977\",\n\t\"name\": \"preliminary-survey-of-biodiversity-in-new-chicago-marsh\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During the late winter and early springs
  1995, we conducted a preliminary survey of biodiversity in New Chicago Marsh (NCM),
  at the south end of San Francisco Bay, Santa Clara County, California.  The site,
  a diked salt marsh, is part of the San Francisco Bay National Wildlife Refuge Complex.
  Working from established transects, we measured the percent cover and height of
  vegetation, hand-trapped, netted, and seined invertebrates and fishes, black-lighted
  insects, conducted time-constrained searches for amphibians and reptiles, used point
  counts for birds, carried out sweep surveys and night spotlighting for larger mammals
  and live-trapped smaller mammals. There has been an apparent increase in the height
  of pickleweed over the past decade. We found numerous species of invertebrates that
  we classified into 16 separate orders. Several species of animals not previously
  reported at NCM were recorded such as the three-spined stickleback (Gasterosteus
  aculeatus), rainwater killifish (Lucania parva), California slender salamander (Batrachoseps
  attenuatus), southern alligator lizard (Elgaria multicarinata), western racer (Coluber
  constrictor), numerous raptorial birds including the peregrine falcon (Falco peregrinus)
  and the long-tailed weasel (Mustela frenata). Alien red foxes  (Vulpes fulva) used
  the upland areas of the site for denning. The most significant result of this study
  was the discovery of a high population abundance of the salt marsh harvest mouse
  (Reithrodontomys raviientris), a federally-endangered species that is sometimes
  abundant in diked salt marshes. Further studies are needed to determine why high
  abundances sometimes occur in diked salt marshes.\",\n\t\"license_title\": \"License
